import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Logreg from './containers/Logreg';
import Start from './components/Start';
import * as serviceWorker from './serviceWorker';

class Layout extends React.Component {
    state = {
        //activeMenu: "Learning",
        activeMenu: "Start",
    }
    renderSection = () => {
        switch (this.state.activeMenu) {
            case "Start":
                return <Start/>
           /* case "Slogin":
                return <Slogin/>
            case "Tlogin":
                return <Tlogin/>*/
            default:
                return <div></div>;
        }
    }
    changeSection = (newSection) => {
        this.setState({activeMenu: newSection});
    }
    unselected = "side-bar-button";
    selected = "side-bar-button active";
    render() {
      return (
       <div>
        <div className="teacherStudentCircles">
            <div className="teacherDiv">
				<button className="buttonTeacher indexButton" onClick={() => this.changeSection("Versus")}></button>
                <div className="textUnderIndexButton">Teacher</div>
            </div>
        </div>

        <div className="teacherStudentCircles">
            <div className="studentDiv">
				<button className="buttonStudent indexButton"></button>
                <div className="textUnderIndexButton">Student</div>
            </div>
        </div>
    </div>
        
      );
    }
}
ReactDOM.render(<Layout />, document.getElementById('react-section'));

serviceWorker.unregister();
